pragma solidity ^0.7.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IV2Router {

    function addLiquidity(IERC20 tokenA, uint aAmount, IERC20 tokenB, uint bAmount)
        external 
        returns (address);

    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut)
        external
        view
        returns (uint amount);

    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut)
        external
        view
        returns (uint amount);

    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);

    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}","keccak256":"0xb40f85d37d6c7da7f6d2a222cdda2fba2ab7a52c6e6192d1ad456874573053b0","license":"Unlicense"},"contracts/libs/LibAccess.sol":{"content":"//SPDX-License-Identifier: Unlicense
pragma solidity ^0.7.0;

import "../Types.sol";


library LibAccess {

    function hasRole(Types.AccessControl storage ac, bytes32 role, address actor) external view returns (bool) {
        return ac.roles[role][actor];
    }

    function _addRole(Types.AccessControl storage ac, bytes32 role, address actor) internal  {
        ac.roles[role][actor] = true;
    }

    function _revokeRole(Types.AccessControl storage ac, bytes32 role, address actor) internal  {
        delete ac.roles[role][actor];
    }
}","keccak256":"0x30f51b897619d1a661871173b3572497bf68a4e5d7faaf20ebfffe4137c13984","license":"Unlicense"},"contracts/libs/LibStorage.sol":{"content":"//SPDX-License-Identifier: Unlicense
